import{_ as t,c as e,ai as n,o as a}from"./chunks/framework.BrYByd3F.js";const c=JSON.parse('{"title":"Mongo进阶 - DB核心：备份恢复","description":"","frontmatter":{},"headers":[],"relativePath":"db/nosql-mongo/mongo-z-backup.md","filePath":"db/nosql-mongo/mongo-z-backup.md","lastUpdated":1737706346000}'),r={name:"db/nosql-mongo/mongo-z-backup.md"};function m(p,o,g,l,s,i){return a(),e("div",null,o[0]||(o[0]=[n('<h1 id="mongo进阶-db核心-备份恢复" tabindex="-1">Mongo进阶 - DB核心：备份恢复 <a class="header-anchor" href="#mongo进阶-db核心-备份恢复" aria-label="Permalink to &quot;Mongo进阶 - DB核心：备份恢复&quot;">​</a></h1><blockquote><p>mongoexport/mongoimport导入/导出的是JSON格式，而mongodump/mongorestore导入/导出的是BSON格式</p></blockquote><h2 id="mongodb的备份恢复" tabindex="-1">MongoDB的备份恢复 <a class="header-anchor" href="#mongodb的备份恢复" aria-label="Permalink to &quot;MongoDB的备份恢复&quot;">​</a></h2><blockquote><p>mongoexport/mongoimport导入/导出的是JSON格式，而mongodump/mongorestore导入/导出的是BSON格式。</p></blockquote><p>JSON可读性强但体积较大，BSON则是二进制文件，体积小但对人类几乎没有可读性。</p><p>在一些mongodb版本之间，BSON格式可能会随版本不同而有所不同，所以不同版本之间用mongodump/mongorestore可能不会成功，具体要看版本之间的兼容性。当无法使用BSON进行跨版本的数据迁移的时候，使用JSON格式即mongoexport/mongoimport是一个可选项。跨版本的mongodump/mongorestore并不推荐，实在要做请先检查文档看两个版本是否兼容（大部分时候是的）。</p><p>JSON虽然具有较好的跨版本通用性，但其只保留了数据部分，不保留索引，账户等其他基础信息。使用时应该注意。</p><h3 id="json格式-mongoexport-mongoimport" tabindex="-1">JSON格式：mongoexport/mongoimport <a class="header-anchor" href="#json格式-mongoexport-mongoimport" aria-label="Permalink to &quot;JSON格式：mongoexport/mongoimport&quot;">​</a></h3><p>JSON可读性强但体积较大，JSON虽然具有较好的跨版本通用性，但其只保留了数据部分，不保留索引，账户等其他基础信息。</p><h3 id="bson格式-mongoexport-mongoimport" tabindex="-1">BSON格式：mongoexport/mongoimport <a class="header-anchor" href="#bson格式-mongoexport-mongoimport" aria-label="Permalink to &quot;BSON格式：mongoexport/mongoimport&quot;">​</a></h3><p>BSON则是二进制文件，体积小但对人类几乎没有可读性。</p><h2 id="参考文章" tabindex="-1">参考文章 <a class="header-anchor" href="#参考文章" aria-label="Permalink to &quot;参考文章&quot;">​</a></h2><p><a href="https://www.cnblogs.com/clsn/p/8244206.html" target="_blank" rel="noreferrer">https://www.cnblogs.com/clsn/p/8244206.html</a></p><p>本文转自 <a href="https://pdai.tech" target="_blank" rel="noreferrer">https://pdai.tech</a>，如有侵权，请联系删除。</p>',14)]))}const h=t(r,[["render",m]]);export{c as __pageData,h as default};
